import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import WelcomePage from './pages/WelcomePage';
import FocusMode from './pages/FocusMode';
import DistractionCheck from './pages/DistractionCheck';
import RewardSystem from './pages/RewardSystem';
import StudyChallenges from './pages/StudyChallenges';
import Analytics from './pages/Analytics';
import Settings from './pages/Settings';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<WelcomePage />} />
        <Route path="/focus" element={<FocusMode />} />
        <Route path="/distraction" element={<DistractionCheck />} />
        <Route path="/rewards" element={<RewardSystem />} />
        <Route path="/challenges" element={<StudyChallenges />} />
        <Route path="/analytics" element={<Analytics />} />
        <Route path="/settings" element={<Settings />} />
      </Routes>
    </Router>
  );
}

export default App;
